Group by time interval spring-data-mongo<p>Below is my document structure:</p>

<pre><code>{
   "_id":"5c59c35d8610f702d00e6f70",
   "stationId":"2",
   "listenerId":"807",
   "streamId":"37",
   "userAgentId":"7",
