   "endTime":"2018-02-06T12:53:56.000Z",
   "listenLength":"117",
   "totalDataUsed":"1433582",
}
</code></pre>

<p>Using spring data mongo I would like to group these into windows of time (lets say 15 min intervals). I have created the following working query:</p>

<pre><code>{
   '_id':{
      'year':{
         '$year':'$startTime'
      },
      'week':{
         '$week':'$startTime'
