Update a json document in a mongodb database<p>I'm trying to update an existing document in a MongoDb. There are many explanations how to do this if you want to update or add key/value pairs on the first level. But in my use-case, I need to create with the first <code>updateOne</code> (with upsert option set) a document with the following structure: </p>

<pre><code>{
  "_id" : "1234", 
  "raw" : {
    "meas" : {
      "meas1" : {
        "data" : "blabla"
      }
    }
  }
}
</code></pre>

<p>In the second command, I need to add - in the same document - a <code>"meas2"</code> field at the level of <code>"meas1"</code>. My desired output is: </p>

<pre><code>{
  "_id" : "1234", 
  "raw" : {
    "meas" : {
      "meas1" : {
        "data" : "blabla"
      },
      "meas2" : {
        "data" : "foo"
      }
    }
  }
}
</code></pre>

<p>I played with statements like </p>

<pre><code>updateOne({"_id":"1234"},{$set:{"raw":{"meas":{"meas2":{"data":"foo"}}}}}, {"upsert":true})
</code></pre>

<p>and also with <code>$push</code>, both variants with <code>insert</code> - here only the document and also <code>insertOne</code>, but nothing produces the desired output. Is there a MongoDb expert who could give a hint ? ... I'm sure this functionality exists... Thanks in advance!</p>

