Copy and rename a document field in MongoDB<p>I want to rename a field that all documents have in my Mongo collection. <a href="https://stackoverflow.com/questions/9254351/how-can-i-rename-a-field-for-all-documents-in-mongodb">There's already a great answer for that</a>. But instead of overwriting the current property name, I want to save my renamed property as a new field, leaving the original intact.</p>

<p>Imagine my documents look like this:</p>

<pre><code>{
  "property": "Original property value"
}
</code></pre>

<p>I want to obtain this:</p>

